{
  "name": "monorepo",
  "private": true,
  "packageManager": "pnpm@9.12.0",
  "scripts": {
    "build": "turbo run build",
    "build:pkg": "pnpm --filter @radix-ui/themes build",
    "dev": "turbo run dev --no-cache --continue",
    "lint": "turbo run lint",
    "clean": "turbo run clean && rm -rf node_modules .turbo"
  },
  "devDependencies": {
    "@types/node": "^20.16.10",
    "@types/react": "^19.0.2",
    "@types/react-dom": "^19.0.2",
    "turbo": "^2.3.3"
  },
  "pnpm": {
    "overrides": {
      "string-width": "4.2.3"
    }
  }
}
